import React, { Component } from "react";
import "./Dashborad.css";

import openSocket from "socket.io-client";
const socket = openSocket("http://localhost:7000");

export default class Dashboard extends Component {
  render() {
    return (
      <div className="mainchatdiv">
        <div id="header">
          <div id="sendername"></div>
          <div id="appBar"><p></p>Chat Application</div>
          <div>
            <button class="LogOutButton">Log Out</button>
          </div>
        </div>
        <div className="messageField">
            <div id="field">
            <div id="ReceiverName">
              <div id="ReceiverNameText"></div>
            </div>
            <div id="chatAppField"></div>
            <div id="inputField">
              <input class="input" placeholder="type here..."></input>
              <div className="sendButton">
                <button id="send">Send</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
